        this.setState({ user: this.props.user })
        console.log(this.state.user)
        }

    componentWillUnmount() {
        this.setState({ user: {} })
    }


    render() {
        if (this.props.user === null)
        return (
            <div>Hello World</div>
        );
    }
}

export default GameContainer
